import './App.css';
import FuelQuoteForm from './FuelQuoteForm';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <h1>Hello World!</h1>


    <Routes>
      <Route path="/fuel-quote-form" element={<FuelQuoteForm />}></Route>
    </Routes>

  </div>
  );
}

export default App;
